import React from 'react';
import './Home.css';
import Particles from 'react-tsparticles';
const Home = () => {
    const particlesInit = (main) => {
        console.log(main);


    };

    const particlesLoaded = (container) => {
        console.log(container);
    };

    return (
        <div className="w-100 rox">

            <div class="container  container-fluid w-100 my-5" id="particles-js" >

                <div class="row">
                    <Particles id="tsparticles"
                        init={particlesInit}
                        loaded={particlesLoaded}
                        options={{
                            background: {
                                color: {
                                    value: "#0d47a1",
                                },
                            },
                            fpsLimit: 120,
                            interactivity: {
                                events: {
                                    onClick: {
                                        enable: true,
                                        mode: "push",
                                    },
                                    onHover: {
                                        enable: true,
                                        mode: "repulse",
                                    },
                                    resize: true,
                                },
                                modes: {
                                    push: {
                                        quantity: 4,
                                    },
                                    repulse: {
                                        distance: 200,
                                        duration: 0.4,
                                    },
                                },
                            },
                            particles: {
                                color: {
                                    value: "#ffffff",
                                },
                                links: {
                                    color: "#ffffff",
                                    distance: 150,
                                    enable: true,
                                    opacity: 0.5,
                                    width: 1,
                                },
                                collisions: {
                                    enable: true,
                                },
                                move: {
                                    direction: "none",
                                    enable: true,
                                    outModes: {
                                        default: "bounce",
                                    },
                                    random: false,
                                    speed: 6,
                                    straight: false,
                                },
                                number: {
                                    density: {
                                        enable: true,
                                        area: 800,
                                    },
                                    value: 80,
                                },
                                opacity: {
                                    value: 0.5,
                                },
                                shape: {
                                    type: "circle",
                                },
                                size: {
                                    value: { min: 1, max: 5 },
                                },
                            },
                            detectRetina: true,
                        }}
                    />
                    <div class="col">
                        1 of 2
                    </div>
                    <div class="col">
                        <div class=" mx-auto w-100 profile">
                            <img src="image/polash.png" class="card-img-top img-fluid" alt="..." />

                        </div>

                    </div>
                </div>

            </div>

        </div>
    );
};

export default Home;
